    }
    const loose = {
      color: "red"
    }
    let S = rnd == predict ? <p style={{color: "green"}}>`You win!`</p> : <p style={{color: "red"}}>`You loose!`</p>
  return (

    <div className="App">
      <header className="App-header">
      <p>Try to predict number from 1 to 10!</p>

      <p style={{S}}>This time number is {rnd}</p>
      </header>

      <img src={logo} className="App-logo" alt="logo" />
    </div>

  );
}

